(77, 'widget_text', 'a:6:{i:1;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:1119:\"<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\"><img class=\"img-fluid side-logo mb-3\" src=\"https://www.pksol.com/wp-content/uploads/2020/06/logo.png\" alt=\"Image\" />\r\n<p class=\"mb-5\">PK SOL - Digital Marketing Agency Responsive HTML5 Template is Most PowerFull template 2018 For Everyone, Start working with an company that provide everything you need to generate awareness.</p>\r\n\r\n<div class=\"form-info\">\r\n<h4 class=\"title\">Contact info</h4>\r\n<ul class=\"contact-info list-unstyled mt-4\">\r\n 	<li class=\"mb-4\"><i class=\"flaticon-location\"></i>Address:423B, Road Wordwide Country, USA</li>\r\n 	<li class=\"mb-4\"><i class=\"flaticon-call\"></i>Phone:<a href=\"tel:+912345678900\">+91-234-567-8900</a></li>\r\n 	<li><i class=\"flaticon-email\"></i>Email<a href=\"mailto:htinfotech7@gmail.com\"> htinfotech7@gmail.com</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"social-icons social-colored mt-5\">\r\n<ul class=\"list-inline\">\r\n 	<li class=\"mb-2 social-facebook\"></li>\r\n 	<li class=\"mb-2 social-twitter\"></li>\r\n 	<li class=\"mb-2 social-linkedin\"></li>\r\n 	<li class=\"mb-2 social-gplus\"></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:2;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:1138:\"<div class=\"ht-theme-info bg-contain bg-pos-r h-100 dark-bg text-white\" data-bg-img=\"http://sttheme.com/demosd/loptus1/wp-content/uploads/2019/01/02.png\">\r\n    <div class=\"footer-logo\"><img class=\"img-center\" src=\"https://www.pksol.com/wp-content/uploads/2020/06/logo.png\" alt=\"Image\" /></div>\r\n    <p class=\"mb-3\">PK SOL is a Digital Solution Provider and has worked with clients belonging to different sectors of society from small organizations to corporate enterprises. Providing customized software and internet solutions.</p>\r\n    <a class=\"btn-simple\" href=\"#\">Read More <i class=\"fas fa-long-arrow-alt-right\"></i></a>\r\n    <script src=\"https://kit.fontawesome.com/a076d05399.js\" crossorigin=\"anonymous\"></script>\r\n\r\n    <div class=\"social-icons social-border circle social-hover mt-5\">\r\n        <h4 class=\"title\">Follow Us</h4>\r\n        <ul class=\"list-inline\">\r\n            <li class=\"fab fa-facebook\"></li>\r\n            <li class=\"fab fa-twitter\"></li>\r\n            <li class=\"fab fa-google-plus\"></li>\r\n            <li class=\"fab fa-linkedin\"></li>\r\n            <li class=\"fab fa-skype\"></li>\r\n        </ul>\r\n    </div>\r\n</div>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:3;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:580:\"<h4 class=\"title\">Usefull links</h4>\r\n<div class=\"row\">\r\n	<div class=\"col-sm-5\">\r\n		<ul class=\"list-unstyled\">\r\n		 	<li><a href=\"/home\">HOME</a></li>\r\n		 	<li><a href=\"/services\">SERVICES</a></li>\r\n		 	<li><a href=\"/portfolio\">PORTFOLIO</a></li>\r\n		 	<li><a href=\"/products\">PRODUCTS</a></li>\r\n		</ul>\r\n	</div>\r\n	<div class=\"col-sm-7\">\r\n		<ul class=\"list-unstyled\">\r\n		 	<li><a href=\"/sms-service\">SMS SERVICE</a></li>\r\n		 	<li><a href=\"/about-us\">ABOUT</a></li>\r\n		 	<li><a href=\"/our-team\">OUR TEAM</a></li>\r\n		 	<li><a href=\"/contact\">CONTACT</a></li>\r\n		</ul>\r\n	</div>\r\n</div>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:4;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:872:\"<h4 class=\"title\">Contact us</h4>\r\n<ul class=\"media-icon list-unstyled\">\r\n 	<li>\r\n<p class=\"mb-0\">Office C-4, 3rd Floor, Econ Plaza (Old Descon Plaza), Nursery, Main Shahrah-e-Faisal, Block 6 PECHS, Karachi, Karachi City, Sindh</p>\r\n</li>\r\n 	<li><a href=\"mailto:info@pksol.com\">info@pksol.com</a></li>\r\n 	<li><a href=\"tel:+922134320202\">+92-21-343-20202</a></li>\r\n 	<li><a href=\"tel:+923022867488\">+92-302-286-7488</a></li>\r\n</ul>\r\n<iframe src=\"https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2Fpksolofficial%2F&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId\" width=\"340\" height=\"500\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"></iframe>\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}i:5;a:4:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:0:\"\";s:6:\"filter\";b:1;s:6:\"visual\";b:1;}s:12:\"_multiwidget\";i:1;}', 'yes'),
